import React from 'react';
import styled from 'styled-components'
import * as Scroll from 'react-scroll'

const Background = styled.div`
    display: flex;
    position: fixed;
    flex-direction: row;
    background-color: #ACBCD2;
    height: 32px;
    padding: 10px;
    width: 100%;
    align-items: center;
    padding-left: 6%;
    z-index: 5;
`

const Title = styled.button`
    margin-right: 50px;
`

const NavButton = styled.button`
`

function ToolBar() {
    return(
        <>
        <Background>
            <Title onClick = {() => Scroll.animateScroll.scrollTo("Image")}> Home </Title>
            <Title onClick = {() => Scroll.animateScroll.scrollTo("About")}> About </Title>
            <Title onClick = {() => Scroll.animateScroll.scrollTo("Work")}> Work </Title>
            <Title onClick = {() => Scroll.animateScroll.scrollTo("Reviews")}> Reviews </Title>
            <Title onClick = {() => Scroll.animateScroll.scrollTo("Contact")}> Contact </Title>
        </Background>
        </>
    )
}

export default ToolBar;
